import React from 'react';
import './appcss.css';
class classScreen extends React.Component {

    render(){
        return (
            <div className="App-header">
                <button onclick="activateLasers()">
                    Activate Lasers
                </button>
            </div>
        )
    }
}

export default classScreen;
